import React from "react"
import {View, TextInput, StyleSheet} from "react-native";


const SearchBar = () => {
    return(
        <View style={styles.container}>
            <TextInput
                placeholder="Search News"
                style={styles.input}

            />
        </View>
    )
}

export default SearchBar;

const styles = StyleSheet.create({
    container:{
        margin: 10
    },
    input:{
        backgroundColor:"#feffef",
        padding: 10,
        borderRadius:10,
        color: "#000"
    }
})
